import React from 'react';

function Footer() {
  return (
    <footer className="social-footer">
      <div className="social-footer-left">
        foot
      </div>
      <div className="social-footer-icons">
        <ul className="menu simple">
          <li><a href="https://www.instagram.com/?hl=en"><i className="fa fa-instagram" aria-hidden="false"></i></a></li>
          <li><a href="https://twitter.com/?lang=en"><i className="fa fa-twitter" aria-hidden="true"></i></a></li>
        </ul>
      </div>
    </footer>


  );
}

export default Footer;
